import './main.css'
let root=ReactDOM.createRoot(document.getElementById('root'));
let mat=[];
for(let i=0;i<5;i++){
  let t=[];
  for(let j=0;j<5;j++)
  t.push(' ');
  mat.push(t);
}
let r;
class Page extends React.Component{
  componentDidMount(){
    r=document.getElementById('root');

  }
  render(){
    return(
      <><Learn/><Grid/><Instruction/><Logicpanel/><Controls/><Play/></>
    )
  }
}
function Grid(){
  return(
    <div className='Grid'>
    {mat.map((arr,index)=><Row arr={arr} row={index}/>)}
    </div>
  )
}
function Row(props){
return(
  <div className='Row'>
    {props.arr.map((element,index)=><Element val={element} row={props.row} col={index}/>)}
  </div>
)
}
function Element(props){
  const [value,setValue]=useState(props.val);
  return(
    <div className='Element'>
      {value}
    </div>
  )
}
function Instruction(){
